css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post {
background: #FFFFFF url('data:image/jpeg;base64,') center center no-repeat !important;
background-size: 525px auto !important;
}

.new_post_label > SPAN {font-size: 0}
.new_post_label:hover {
  background-color: rgba(255,255,255,.4) !important;
}
.new_post_label > I::before {content: none}

}
